mapper.select:
WITH master AS ( SELECT "B"."hihokenshaNo" AS "taishoHihokenshaNo" ,"B"."rirekiNo" AS "rirekiNo" ,substring("B"."jikoFutanKeisanYMD" from 1 for 6) AS "jikoFutanKeisanYM" ,"B"."taishoNendo" AS "taishoNendo" ,"B"."hokenshaNo" AS "hokenshaNo" ,"B"."shikyuShinseishoSeiriNo" AS "shikyuShinseishoSeiriNo" ,"B"."taishoKeisanKaishiYMD" AS "taishoKeisanKaishiYMD" ,"B"."taishoKeisanShuryoYMD" AS "taishoKeisanShuryoYMD" ,"B"."hihokenshaKaishiYMD" AS "kanyuKaishiYMD" ,"B"."hihokenshaShuryoYMD" AS "kanyuShuryoYMD" ,"B"."shinseiYMD" AS "shinseiYMD" ,"B"."kokuho_HihokenshaShoKigo" AS "kokuho_HihokenshaShoKigo" ,"V1001"."hihokenshaNo" AS "daichoHihokenshaNo" ,(CASE "V1001"."koikinaiJushochiTokureiFlag" WHEN '1' THEN "V1001"."koikinaiTokureiSochimotoShichosonCode" ELSE "V1001"."shichosonCode" END) AS "shichosonCode" ,"V1001"."shikibetsuCode" AS "shikibetsuCode" FROM (SELECT "dbt3070"."hihokenshaNo" ,"dbt3070"."taishoNendo" ,"dbt3070"."hokenshaNo" ,"dbt3070"."shikyuShinseishoSeiriNo" ,MAX("dbt3070"."rirekiNo") AS "rirekiNo" FROM rgdb."DbT3070KogakuGassanJikoFutanGaku" AS "dbt3070" WHERE "dbt3070"."isDeleted"= False GROUP BY "dbt3070"."hihokenshaNo" ,"dbt3070"."taishoNendo" ,"dbt3070"."hokenshaNo" ,"dbt3070"."shikyuShinseishoSeiriNo" ) AS "K" INNER JOIN rgdb."DbT3070KogakuGassanJikoFutanGaku" AS "B" ON "K"."hihokenshaNo" = "B"."hihokenshaNo" AND "K"."taishoNendo" = "B"."taishoNendo" AND "K"."hokenshaNo" = "B"."hokenshaNo" AND "K"."shikyuShinseishoSeiriNo" = "B"."shikyuShinseishoSeiriNo" AND "K"."rirekiNo" = "B"."rirekiNo" LEFT JOIN rgdb."DbV1001HihokenshaDaicho" AS "V1001" ON "V1001"."hihokenshaNo"= "B"."hihokenshaNo" WHERE "B"."isDeleted" = False AND '2014'<="B"."taishoNendo" AND "B"."dataSakuseiKubun"='1'
AND "B".自己負担額証明書情報受取年月=#{抽出期間開始年月}
AND "B"."taishoNendo" = #{年度} AND "B"."hihokenshaNo" =#{被保険者番号}
) SELECT master."taishoHihokenshaNo" AS "taishoHihokenshaNo" ,master."rirekiNo" AS "rirekiNo" ,master."jikoFutanKeisanYM" AS "jikoFutanKeisanYM" ,master."taishoNendo" AS "taishoNendo" ,master."hokenshaNo" AS "hokenshaNo" ,master."shikyuShinseishoSeiriNo" AS "shikyuShinseishoSeiriNo" ,master."taishoKeisanKaishiYMD" AS "taishoKeisanKaishiYMD" ,master."taishoKeisanShuryoYMD" AS "taishoKeisanShuryoYMD" ,master."kanyuKaishiYMD" AS "kanyuKaishiYMD" ,master."kanyuShuryoYMD" AS "kanyuShuryoYMD" ,master."shinseiYMD" AS "shinseiYMD" ,master."kokuho_HihokenshaShoKigo" AS "kokuho_HihokenshaShoKigo" ,master."daichoHihokenshaNo" AS "daichoHihokenshaNo" ,master."shichosonCode" AS "shichosonCode" ,"ShikibetsuTaisho"."kanaMeisho" AS "kanaMeisho" ,"ShikibetsuTaisho"."meisho" AS "meisho" ,"ShikibetsuTaisho"."seinengappiYMD" AS "seinengappiYMD" ,"ShikibetsuTaisho"."seibetsuCode" AS "seibetsuCode" ,"ShikibetsuTaisho"."yubinNo" AS "yubinNo" ,"ShikibetsuTaisho"."choikiCode" AS "choikiCode" ,"ShikibetsuTaisho"."gyoseikuCode" AS "gyoseikuCode" ,"ShikibetsuTaisho"."shikibetsuCode" AS "shikibetsuCode" ,"ShikibetsuTaisho"."juminShubetsuCode" AS "juminShubetsuCode" FROM master LEFT JOIN
(SELECT ARRAY_AGG(CAST (master."shikibetsuCode" AS TEXT)) FROM master)
AS "ShikibetsuTaisho" ON "ShikibetsuTaisho"."shikibetsuCode"=master."shikibetsuCode" ORDER BY master."taishoHihokenshaNo" ASC
